        have read and accepted our terms of use, cookie and privacy policy.
        Copyright 1999-2023 by Refsnes Data. All Rights Reserved. W3Schools is
        Powered by W3.CSS.
      </p>
    </footer>
  );
}
root.render(
  <div>
    <Navbar></Navbar>
    <Search></Search>
    <Products></Products>
    <About></About>
    <Footer></Footer>
  </div>
);
